DROP TABLE IF EXISTS `division`;
CREATE TABLE `division` (
  `divisionId` varchar(10) CHARACTER SET utf8 NOT NULL,
  `DivisionName` varchar(500) CHARACTER SET utf8 NOT NULL,
  `Address` varchar(500) CHARACTER SET utf8 DEFAULT NULL,
  `Telephone` varchar(500) CHARACTER SET utf8 DEFAULT NULL,
  `Mobile` varchar(500) CHARACTER SET utf8 DEFAULT NULL,
  `GMName` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `Degination` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `EmailId` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`divisionId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

